import {Link} from "react-router-dom";
import { Nav, Navbar,Dropdown,DropdownButton } from 'react-bootstrap'

class HomePage extends Component {
    constructor() {
      super();
      this.state = {
        username: "",
        password: "",
        data: []
    };
    }
    handleLogout = () => {
      this.setState({});
      this.setState({ username: "" });
      this.setState({ password: "" });
      localStorage.clear();
    };

    render() {
      return (
